  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор товара',
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название товара',
  `price` int unsigned DEFAULT NULL,
