DROP TABLE IF EXISTS `orders`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `orders` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор заказа',
  `from_company_id` int unsigned NOT NULL COMMENT 'Ссылка на компанию отправителя заказа',
  `to_company_id` int unsigned NOT NULL COMMENT 'Ссылка на компанию получателя заказа',
  `from_user_id` int unsigned NOT NULL COMMENT 'Ссылка на отправителя заказа',
  `to_user_id` int unsigned DEFAULT NULL COMMENT 'Ссылка на получателя заказа',
  `paid_at` datetime DEFAULT NULL COMMENT 'Дата получения оплаты',
  `shipped_at` timestamp NULL DEFAULT NULL,
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `orders_to_company_id_fk` (`to_company_id`),
  KEY `orders_from_user_id_fk` (`from_user_id`),
  KEY `orders_to_user_id_fk` (`to_user_id`),
  KEY `orders_from_company_id_fk` (`from_company_id`),
  CONSTRAINT `orders_from_company_id_fk` FOREIGN KEY (`from_company_id`) REFERENCES `companies` (`id`),
  CONSTRAINT `orders_from_user_id_fk` FOREIGN KEY (`from_user_id`) REFERENCES `users` (`id`),
  CONSTRAINT `orders_to_company_id_fk` FOREIGN KEY (`to_company_id`) REFERENCES `companies` (`id`),
  CONSTRAINT `orders_to_user_id_fk` FOREIGN KEY (`to_user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=103 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Заказы';
/*!40101 SET character_set_client = @saved_cs_client */;

